create table csml_category_classification_code
(
    id_category_classification_code       integer not null
        constraint csml_category_classification_codes_pk
            primary key autoincrement,
    type_category                         integer                                                                                              not null
        constraint csml_category_classification_codes_csml_type_category_type_cate
            references csml_type_category,
    name_category_classification_code     text,
    name_category_classification_code_rus text,
    code_category_classification_code     text,
    code_category_classification_code_rus text,
    name_category_classification_main     text
);


create table csml_category_classification_code_mapping
(
    id_category_classification_code_mapping integer not null
        constraint csml_category_classification_codes_mapping_pk
            primary key autoincrement,
    id_category_classification_code         integer                                                                                              not null
        constraint fk_category_classification_code_csml_category_classification_co
            references csml_category_classification_code,
    type_category_to                        integer                                                                                              not null
        constraint csml_category_classification_codes_csml_type_category_type_cate
            references csml_type_category,
    code_category_classification_code       text,
    code_category_classification_code_rus   text,
    value_category                          text
);





