INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (1, 32, 'The transition to advanced digital, intelligent production technologies, robotic systems, new materials and methods of construction, creation of systems for processing large volumes of data, machine learning and artificial intelligence', 'Переход к передовым цифровым, интеллектуальным производственным технологиям, роботизированным системам, новым материалам и способам конструирования, создание систем обработки больших объемов данных, машинного обучения и искусственного интеллекта', '1', 'А', null);
INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (2, 32, 'The transition to environmentally friendly and resource-saving energy, improving the efficiency of extraction and deep processing of hydrocarbon raw materials, development of new sources, ways of transportation and energy storage', 'Переход к экологически чистой и ресурсосберегающей энергетике, повышение эффективности добычи и глубокой переработки углеводородного сырья, формирование новых источников, способов транспортировки и хранения энергии', '2', 'Б', null);
INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (3, 32, 'The transition to personalized medicine, high-technology health and technology health savings, including through the rational use of drugs (especially antibacterial)', 'Переход к персонализированной медицине, высокотехнологичному здравоохранению и технологиям здоровьесбережения, в том числе за счет рационального применения лекарственных препаратов (прежде всего антибактериальных)', '3', 'В', null);
INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (4, 32, 'The  transition to a highly productive and environmentally friendly agro - and aquafarm, development and implementation of systems for the rational use of chemical and biological protection of agricultural plants and animals, storing and efficient processing of agricultural products, the creation of safe and high quality, including functional, food/', 'Переход к высокопродуктивному и экологически чистому агро- и аквахозяйству, разработку и внедрение систем рационального применения средств химической и биологической защиты сельскохозяйственных растений и животных, хранение и эффективную переработку сельскохозяйственной продукции, создание безопасных и качественных, в том числе функциональных, продуктов питания', '4', 'Г', null);
INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (5, 32, 'Counteraction of technogenic, biogenic, social and cultural threats, terrorism and ideological extremism, as well as cyber threats and other hazards to society, economy and state/', 'Противодействие техногенным, биогенным, социокультурным угрозам, терроризму и идеологическому экстремизму, а также киберугрозам и иным источникам опасности для общества, экономики и государства', '5', 'Д', null);
INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (6, 32, 'The connectivity of the territory of the Russian Federation due to the creation of intelligent transport and telecommunication systems, as well as taking and holding leadership positions in the creation of international transport and logistics systems, the development and utilization of outer space and air space, the World ocean, Arctic and Antarctiс/ ', 'Связанность территории Российской Федерации за счет создания интеллектуальных транспортных и телекоммуникационных систем, а также занятия и удержания лидерских позиций в создании международных транспортно-логистических систем, освоении и использовании космического и воздушного пространства, Мирового океана, Арктики и Антарктики', '6', 'Е', null);
INSERT INTO csml_category_classification_code (id_category_classification_code, type_category, name_category_classification_code, name_category_classification_code_rus, code_category_classification_code, code_category_classification_code_rus, name_category_classification_main) VALUES (7, 32, 'The possibility of effective response of the Russian society at large calls with account of interaction of man and nature, man and technology, social institutions on the modern stage of global development, including using methods of the Humanities and Social sciences/ ', 'Возможность эффективного ответа российского общества на большие вызовы с учетом взаимодействия человека и природы, человека и технологий, социальных институтов на современном этапе глобального развития, в том числе применяя методы гуманитарных и социальных наук', '7', 'Ж', null);
